// frontend/src/BusinessCard.js
import React from 'react';

function BusinessCard({ user }) {
  return (
    <div className="business-card">
      <h2>{user.name}の名刺</h2>
      <p>出身地: {user.hometown}</p>
      <p>MBTI: {user.mbti}</p>
      <p>趣味: {user.hobbies}</p>
      <p>好きな食べ物: {user.favoriteFood}</p>
    </div>
  );
}

export default BusinessCard;
